import React from 'react';
import './Modal.css';

export class Modal extends React.Component {


  render() {
    const { modal, chench  } = this.props

    return (
      <div className={(modal) ? '' : 'modal'}>
        <p hidden={modal}>Delete Todo, are you sure?</p>
        <div className='modal__content' hidden={modal}>
            <button onClick={() => (
              chench(true)
            )}>
              delete
            </button>
            <button onClick={() => (
              chench(false)
            )}>
              cancel
            </button>

        </div>
      </div>
    )
  }
}
